INSERT [cmsStylesheet] ([nodeId], [filename], [content]) VALUES (1066, N'', N'/****************************************************
   - TEXT
****************************************************/
p { margin: 0 0 9px; }
p small { font-size: 11px; color: #999999; }
h1, h2, h3, h4, h5,
h1 a, h2 a, h3 a, h4 a, h5 a,
.h1, .h2, .h3, .h4, .h5,
.h1 a, .h2 a, .h3 a, .h4 a, .h5 a{ margin: 0; font-family: inherit; font-weight: bold; color: inherit; text-rendering: optimizelegibility; }
h1 a:hover, h2 a:hover, h3 a:hover, h4 a:hover, h5 a:hover,
.h1 a:hover, .h2 a:hover, .h3 a:hover, .h4 a:hover, .h5 a:hover { color:#333; }

h1, .h1 { font-size: 54px; line-height: 1; border-bottom:1px solid #e9e9ea; padding-bottom:20px; margin-bottom:30px; }
h2, .h2 { font-size: 24px; line-height: 36px; }
h3, .h3 { font-size: 18px; line-height: 27px; }
h4, .h4, h5, .h5 { line-height: 18px; }
h4, .h4 { font-size: 14px; }
h5, .h5 { font-size: 12px; }

a, a:link { text-decoration: none; outline: none; }

/****************************************************
   - MASTER SETUP
****************************************************/
html, body { height: 100%; }
body { background: url(''/css/gfx/bg.jpg'') repeat-x; }
div#wrapper { min-height: 100%; height: auto !important; height: 100%; margin: 0 auto -500px; }
div#wrapper div.push { height:500px; }

div#content { padding:20px 0; }
div#content div#left,
div#content div#right,
div#content div#main { float:left; }
div#content div#left { width:209px; min-height:10px; }
div#content div#right { width:240px; }
div#content div#main { width:441px; padding:0 25px; overflow:hidden; }

body.Frontpage div#content div#main,
div#content div#pageOneCol div#main { width:100%; padding:0; }
div#content div#pageTwoCol div#main { width:685px; padding:0 15px 0 0; }
div#content div#pageTwoColNoBox div#main { width:701px; padding:0 0 0 30px; }

div.container { padding:0 20px; }

/****************************************************
   - TOP
****************************************************/
div#top {  }
div#top div.container.top-stuff { height:121px; position:relative; }
div#top div#topImage { position:relative; z-index:1; }
div#top a#logo { padding:25px 20px 20px 0; float:left; }
/*** Main Menu ***/
.dropdown-menu .active > a,
.dropdown-menu .active > a:hover { color:#fff; }

ul#serviceMenu { list-style: none; padding:0; margin:0; width:280px; position:absolute; top:25px; right:380px; }
ul#serviceMenu li { float:left; width:130px; padding-left:10px; text-align:right; }
ul#serviceMenu li a { color:#6e6e6e; font-size:12px; }

/*** Main Menu ***/
div#top div.navbar-inner { background: url(''/css/gfx/menu-pattern.png''); padding:0; }
div#top div.navbar ul.nav li.dropdown > .dropdown-toggle .caret { border-top-color: #000; border-bottom-color: #000; }
div#top div.navbar ul.nav > li > a { color: #000; text-decoration: none; text-shadow: none; }
div#top .navbar .nav li.dropdown.open > .dropdown-toggle, 
div#top .navbar .nav li.dropdown.active > .dropdown-toggle, 
div#top .navbar .nav li.dropdown.open.active > .dropdown-toggle { background-color:rgba(202,167,106,0.5); }

div#top div.navbar-inner div.container { position: relative; }
div#top div.navbar-inner div.search-simple { float:right; margin: 0; padding-top:5px; }
div#top div.navbar-inner div.search-simple form *,
div#top div.navbar-inner div.search-simple form { margin:0; }
div#top div.navbar-inner div.search-simple form input#topSearchQ { font-size:12px; }

/*** resetting main menu default styling ***/
.navbar .nav > .active > a:hover, 
.navbar .nav > .active > a:focus,
.navbar .nav > .active > a { color: #000; text-decoration: none; background-color: inherit; -webkit-box-shadow: none; -moz-box-shadow: none; box-shadow: none; }
/****************************************************
   - FOOTER
****************************************************/
/*** SUBFOOTER ***/

div#subfooter { height:275px; background: #e4e4e4; background: #696868; /* Old browsers */ /* IE9 SVG, needs conditional override of ''filter'' to ''none'' */ background: url(data:image/svg+xml;base64,); background: -moz-linear-gradient(top,  #696868 12%, #e4e4e4 100%); /* FF3.6+ */ background: -webkit-gradient(linear, left top, left bottom, color-stop(12%,#696868), color-stop(100%,#e4e4e4)); /* Chrome,Safari4+ */ background: -webkit-linear-gradient(top,  #696868 12%,#e4e4e4 100%); /* Chrome10+,Safari5.1+ */ background: -o-linear-gradient(top,  #696868 12%,#e4e4e4 100%); /* Opera 11.10+ */ background: -ms-linear-gradient(top,  #696868 12%,#e4e4e4 100%); /* IE10+ */ background: linear-gradient(to bottom,  #696868 12%,#e4e4e4 100%); /* W3C */ filter: progid:DXImageTransform.Microsoft.gradient( startColorstr=''#696868'', endColorstr=''#e4e4e4'',GradientType=0 ); /* IE6-8 */  } 
div#subfooter table { margin: 20px 0; }
div#subfooter table tr td { vertical-align: top; }
div#subfooter * { color: #ffffff; }
div#subfooter a { color:#ffffff; }
div#subfooter table tr td input { color:#333; }
div#subfooter h3 { font-size: 24px; margin-bottom:15px; }

/*** NEWSLETTER ***/
div#subfooter form.newsletter {  }
div#subfooter form.newsletter .control-label { width:60px; }
div#subfooter form.newsletter .form-horizontal .controls { margin-left:70px; }
div#subfooter form.newsletter input[type="text"] { width:220px; }

/*** THE FOOTER ITSELF ***/
div.footer { height:240px; background: #6b6b6b; }
div.footer div.container { overflow:hidden; position:relative; }

div.footer div.footerText ul { list-style: none; padding:0; margin:0; margin-top:16px; overflow:hidden; }
div.footer div.footerText ul li { float:left; padding:0 5px 0 8px; background:url(gfx/footer-split.png) no-repeat 0 7px; }
div.footer div.footerText ul li:first-child { background:none; padding-left:0; }

/*** SITEMAP ***/
div.footer ul#sitemap,
div.footer ul#sitemap ul { list-style: none; padding:0; margin:0; }
div.footer ul#sitemap { padding-top:20px; }
div.footer ul#sitemap > li { float:left; width:165px;  }
div.footer ul#sitemap li a { text-decoration:none; display:block; font-size:13px; color: #ffffff; }
div.footer ul#sitemap li a.lvl1 { font-size: 16px; }
div.footer ul#sitemap ul { padding-top:20px; }
div.footer ul#sitemap ul li { background: url(''/css/gfx/footer-list-bg.png'') no-repeat center left; padding-left: 10px; }
div.footer ul#sitemap ul li a { text-transform:none; color:#ffffff; }
div.footer ul#sitemap ul li a.inpath { }
div.footer ul#sitemap li > a:hover { background-color: transparent; color: #ffffff; }

/****************************************************
   - SUBMENU
****************************************************/
ul#submenu,
ul#submenu ul { list-style: none; padding:0; margin:0; }
ul#submenu { padding-right:20px; }
ul#submenu li {  }
ul#submenu li a { color: #777777; display: block; border-bottom: 1px solid #ccc; line-height: 30px; height: 30px; padding-left: 4px; font-size: 13px; }
ul#submenu li a.lvl1 { color: #777777; font-weight: bold; font-size: 17px; height: 40px; line-height: 40px; display: block;  }
ul#submenu li a.active {  }
ul#submenu li a.inpath { font-weight:bold; }
ul#submenu ul li {  }
ul#submenu ul li a { padding-left:20px; }
ul#submenu ul li a.active {  }
ul#submenu ul li a.inpath {  }

/****************************************************
   - NEWS
****************************************************/
ul.newsList { list-style: none; padding: 0; margin: 0; }
ul.newsList li div.newsDate { position:relative; color:#ccc; font-size:10px; text-transform:uppercase; top:-7px; }6c401d

/*** NEWS PAGE ***/
body.News div.newsDate { position:relative; color:#ccc; font-size:10px; text-transform:uppercase; top:-10px; }

/****************************************************
   - CAROUSEL
****************************************************/
.carousel .item img { border-radius:4px; }

/****************************************************
   - WIDGETS
****************************************************/
ul.widgetList { margin:0; padding:0; list-style: none; overflow:hidden; }
ul.widgetList li.widget { border-top:solid 1px #ccc; padding:15px 0; }
ul.widgetList li.widget img.image.lastItem { margin-bottom:15px; }

ul.widgetList.rightWidgets li.widget.pos1 { border-top:0; padding-top:0; }

ul.widgetList.frontpageWidgets { padding: 20px 0; margin: 0; margin-top:5px; }
ul.widgetList.frontpageWidgets li.widget { float:left; width:32%; margin-right:2%; padding-top:20px; }
ul.widgetList.frontpageWidgets li.widget.lastCol { margin-right:0; }
ul.widgetList.frontpageWidgets li.widget.isList { width:100%; margin-right:0; }

/****************************************************
   - BUTTONS
****************************************************/
/*** BROWN ***/
.btn-brown { color: white; text-shadow: 0 -1px 0 rgba(0, 0, 0, 0.25); background-color: #ce8f59; background-image: -moz-linear-gradient(top, #ce8f59, #8f592b); background-image: -webkit-gradient(linear, 0 0, 0 100%, from(#ce8f59), to(#8f592b)); background-image: -webkit-linear-gradient(top, #ce8f59, #8f592b); background-image: -o-linear-gradient(top, #ce8f59, #8f592b); background-image: linear-gradient(to bottom, #ce8f59, #8f592b); background-repeat: repeat-x; border-color: #8f592b #8f592b #ce8f59; border-color: rgba(0, 0, 0, 0.1) rgba(0, 0, 0, 0.1) rgba(0, 0, 0, 0.25); filter: progid:DXImageTransform.Microsoft.gradient(startColorstr=''#ff62c462'', endColorstr=''#8f592b'', GradientType=0); filter: progid:DXImageTransform.Microsoft.gradient(enabled=false); }
.btn-brown:hover,
.btn-brown:active,
.btn-brown.active,
.btn-brown.disabled,
.btn-brown[disabled] {
  color: #ffffff;
  background-color: #8f592b;
  *background-color: #5e3c1f;
}

/*** DARK BROWN ***/
.btn-dark-brown { color: white; text-shadow: 0 -1px 0 rgba(0, 0, 0, 0.25); background-color: #6c401d; background-image: -moz-linear-gradient(top, #6c401d, #3f2511); background-image: -webkit-gradient(linear, 0 0, 0 100%, from(#6c401d), to(#3f2511)); background-image: -webkit-linear-gradient(top, #6c401d, #3f2511); background-image: -o-linear-gradient(top, #6c401d, #3f2511); background-image: linear-gradient(to bottom, #6c401d, #3f2511); background-repeat: repeat-x; border-color: #3f2511 #3f2511 #ce8f59; border-color: rgba(0, 0, 0, 0.1) rgba(0, 0, 0, 0.1) rgba(0, 0, 0, 0.25); filter: progid:DXImageTransform.Microsoft.gradient(startColorstr=''#ff62c462'', endColorstr=''#3f2511'', GradientType=0); filter: progid:DXImageTransform.Microsoft.gradient(enabled=false); }
.btn-dark-brown:hover,
.btn-dark-brown:active,
.btn-dark-brown.active,
.btn-dark-brown.disabled,
.btn-dark-brown[disabled] {
  color: #ffffff;
  background-color: #3f2511;
  *background-color: #5e3c1f;
}

.input-append .add-on:first-child, .input-append .btn:first-child,
.input-append .add-on.first-child, .input-append .btn.first-child {
    border-radius: 4px 0 0 4px; -webkit-border-radius: 4px 0 0 4px; -moz-border-radius: 4px 0 0 4px; margin-left: 0px;
}
.input-append .btn { height: 30px; }
.input-append input.middle-child { border-left:0px; border-radius: 0; -webkit-border-radius: 0; -moz-border-radius: 0; height:28px; line-height:28px; padding:0 5px; }

input.btn { height:30px; }

/****************************************************
   - CONTOUR
****************************************************/
.contourField br { display:none; }
legend {
  border-bottom: 1px solid #ccc;
}

.contourField .radio input[type="radio"], 
.contourField .checkbox input[type="checkbox"] { float:none; }

  
/*** WIDTH ***/
.contourField .control-label { width:100px; }
.contourField .contourNavigation,
.contourField .controls { margin-left:120px; }
.contourField.radio, 
.contourField.checkbox { padding:0; }

/*** CHECKBOXES ***/
.contourField.checkboxlist div.controls { overflow:hidden; }
.contourField.checkboxlist label { padding-top:0px; }
.contourField.checkbox label { padding-top:3px; }

.contourField.checkboxlist div span input,
.contourField.checkboxlist div span label { float:left; }
.contourField.checkboxlist div span input { clear:left; }
.contourField.checkboxlist div span label { text-align: left; width:auto; padding-top:0; padding-left:5px; }

/*** ERRORS ***/
.contourField .contourError { color:#B94A48; }
.contourField input.contourError,
.contourField select.contourError,
.contourField textarea.contourError {
  color: #b94a48;
  border-color: #b94a48;
  -webkit-box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075);
     -moz-box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075);
          box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075);
}

.contourField input.contourError:focus,
.contourField select.contourError:focus,
.contourField textarea.contourError:focus {
  border-color: #953b39;
  -webkit-box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075), 0 0 6px #d59392;
     -moz-box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075), 0 0 6px #d59392;
          box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075), 0 0 6px #d59392;
}

/*** CALENDAR PICKER ***/
.contourField .ajax__calendar > div { z-index:1; }


/*** BREADCRUMBS ***/
div#main .breadcrumb { padding: 0 0 15px 0; margin: 0; list-style: none; background-color: transparent; -webkit-border-radius: 0px; -moz-border-radius: 0px; border-radius: 0px; } 
div#main .breadcrumb li { text-shadow: none; font-size: 13px; color: #000000; }
div#main .breadcrumb li a { font-size: 13px; color: #808080; }















