INSERT [cmsContentXml] ([nodeId], [xml]) VALUES (1208, N'<Page id="1208" parentID="1168" level="4" creatorID="0" sortOrder="2" createDate="2012-12-06T11:18:59" updateDate="2013-03-12T12:27:09" nodeName="Terms and conditions" urlName="terms-and-conditions" path="-1,1054,1059,1168,1208" isDoc="" nodeType="1060" creatorName="Admin" writerName="Admin" writerID="0" template="1087">
