<ol>
<li>If any goods delivered hereunder are held to infringe a third partys patent, utility model, design, trademark or other intellectual property right and you are enjoined from using same, we will, at our option and expense, (i) procure for you the right to continue using the goods; (b) replace the goods with non-infringing substitutes provided that such substitutes do not entail a material diminution in performance or function; (c) modify the goods to make them non-infringing; or (d) refund the purchase price of the goods less a resonable amount for usage. The foregoing states our sole liability for intellectual property rights infringement.</li>
</ol>
<li>Limitation of Liability</li>
<ol>
<li>Neither of us will be entitled to, and neither of us shall be liable for, indirect, special, incidental, consequential or punitive damages of any nature, including, but not limited to, business interruption costs, loss of profit, removal and/or reinstallation costs, reprocurement costs, loss of data, injury to reputation or loss of customers. Your recovery from us for any claim shall not exceed the purchase price for the goods giving rise to such claim irrespective of the nature of the claim, whether in contract, tort, warranty or otherwise.</li>
<li>We shall not be liable for any claims based on our compliance with your designs, specifications or instructions or repair, modification or alteration of any goods by parties other than us or use in combination with other goods.</li>
</ol>
<li>Force Majeure</li>
<ol>
<li>Either party shall be excused from any delay or failure in performance if caused by reason of any occurrence or contingency beyond its reasonable control, including, but not limited to, acts of God, acts of war, fire, insurrection, strikes, lock-outs or other serious labor disputes, riots, earthquakes, floods, explosions or other acts of nature. The obligations and rights of the party so excused shall be extended on a day-to-day basis for the time period equal to the period of such excusable interruption. When such events have abated, the parties respective obligations shall resume. In the event the interruption of the excused partys obligations continues for a period in excess of thirty calendar days, either party shall have the right to terminate the applicable contract(s) of sale, without liability, upon thirty calendar days prior written notice to the other party.</li>
</ol>
<li>Miscellaneous</li>
<ol>
<li>The United Nations Convention for the International Sale of Goods shall not apply to these GTCS or to any contracts of sale entered into between us.</li>
