<li>These GTCS and all contracts of sale entered into between us shall be governed by and construed in accordance with the laws of Denmark without giving effect to any choice of law or conflict of law provisions. Any suits, actions or proceedings that may be instituted by either of us against the other shall be instituted exclusively before the competent courts of Denmark, however, without prejudice to our right to bring suits, actions or proceedings in any other court which would have jurisdiction if this provision had not been incorporated into these GTCS.</li>
