INSERT [cmsPropertyData] ([id], [contentNodeId], [versionId], [propertytypeid], [dataInt], [dataDate], [dataNvarchar], [dataNtext]) VALUES (3496, 1208, N'3dd2ba8a-0907-41ee-9551-6f89a5c1a402', 48, NULL, NULL, N'Terms and conditions', NULL)
INSERT [cmsPropertyData] ([id], [contentNodeId], [versionId], [propertytypeid], [dataInt], [dataDate], [dataNvarchar], [dataNtext]) VALUES (3497, 1208, N'3dd2ba8a-0907-41ee-9551-6f89a5c1a402', 49, NULL, NULL, NULL, N'<ol>
<li>Scope of Applicability</li>
<ol>
<li>These General Terms and Conditions of Sale (GTCS) apply to all sales of goods by us notwithstanding any conflicting, contrary or additional terms and conditions in any purchase order or other communication from you. No such conflicting, contrary or additional terms and conditions shall be deemed accepted by us unless and until we expressly confirm our acceptance in writing.</li>
</ol>
<li>We reserve the right to change these GTCS at any time. We will give you thirty calendar days notice of any changes by posting notice on our website.</li>
<ol>
<li>Offers, Purchase Orders and Order Confirmations</li>
<li>All offers made by us are open for acceptance within fifteen calendar days from the date of issue, unless otherwise specifically stated therein, and are subject to the availability of the goods offered.</li>
<li>All purchase orders issued by you shall specify as a minimum the type and quantity of goods requested, applicable unit prices, delivery place and requested delivery dates. No purchase order shall be binding on us unless and until confirmed by us in writing.</li>
</ol>
<li>Prices and Terms of Payment</li>
<ol>
<li>The prices for goods shall be those set forth in our order confirmation. All prices are exclusive of taxes, impositions and other charges, including, but not limited to, sales, use, excise, value added and similar taxes or charges imposed by any government authority.</li>
<li>Unless expressly stated otherwise in our order confirmation, payment for goods shall be made [insert payment terms] without offset or deduction.</li>
<li>You must submit such financial information from time to time as may be reasonably requested by us for the establishment or continuation of payment terms. We may in our sole discretion at any time change agreed payment terms without notice by requiring payment cash in advance or cash on delivery, bank guarantee, letter of credit or otherwise.</li>
<li>If you fail to pay any invoice within seven calendar days of the due date of payment, we may suspend delivery of any purchase order or any remaining balance thereof until payment is made or terminate delivery of any purchase order or any remaining balance thereof by providing written notice of termination to you within seven calendar days of the expiration of the grace period. Further, we may charge you interest from the due date to the date of payment at the rate of 1  % per month. This shall be in addition to, and not in limitation of, any other rights or remedies to which we are or may be entitled at law or in equity.</li>
<li>Title to goods delivered shall remain vested in us and shall not pass to you until the goods have been paid for in full. If you fail to pay any invoice within fourteen calendar days of the due date of payment, we may retake the goods covered by the invoice. You must insure all goods delivered to their full replacement value until title to the goods has passed to you.</li>
</ol>
<li>Terms of Delivery and Late Delivery</li>
<ol>
<li>Unless expressly stated otherwise in our order confirmation, all deliveries of goods shall be [insert delivery term] in accordance with Incoterms 2000. The risk of loss of or damage to goods shall pass to you in accordance with the agreed delivery term.</li>
<li>The delivery dates of goods shall be those set forth in our order confirmation. If we fail to deliver goods within seven calendar days of the agreed delivery date, you may terminate the applicable purchase order in whole or in part (as to those goods affected by the delay) by providing written notice of termination to us within seven calendar days of the expiration of the grace period. Further, you may claim damages for any loss suffered as a result of the delay subject to the limitation of liability below. These shall be your exclusive remedies for late delivery.</li>
<li>We reserve the right to make delivery in instalments.</li>
</ol>
<li>Acceptance of goods</li>
<ol>
<li>You must inspect goods delivered upon receipt. You are deemed to have accepted goods delivered unless written notice of rejection specifying the reasons for rejection is received by us within five calendar days after delivery of the goods.</li>
</ol>
<li>Warranty</li>
<ol>
<li>We warrant that upon delivery and for a period of twenty-four months from the date of delivery goods purchased hereunder will conform in all material respects to the applicable manufacturers specifications for such goods and will be free from material defects in workmanship, material and design under normal use. The warranty does not cover damage resulting from misuse, negligent handling, lack of reasonable maintenance and care, accident or abuse by anyone other than us.</li>
<li>With respect to goods which do not conform to the warranty our liability is limited, at our election, to (i) refund of the purchase price for such goods less a reasonable amount for usage, (ii) repair of such goods, or (iii) replacement of such goods; provided, however, that such goods must be returned to us, along with acceptable evidence of purchase, within fourteen calendar days after you discovered the lack of conformity or ought to have discovered it.</li>
<li>We make no other warranty, express or implied, with respect to goods delivered hereunder, and the warranty constitutes our sole obligation in respect of any lack of conformity of goods delivered hereunder (except title). In particular, we make no warranty with respect to the merchantability of goods delivered or their suitability or fitness for any particular purpose.</li>
</ol>
<li>Intellectual Property Rights Infringement</li>
<ol>
<li>If any goods delivered hereunder are held to infringe a third partys patent, utility model, design, trademark or other intellectual property right and you are enjoined from using same, we will, at our option and expense, (i) procure for you the right to continue using the goods; (b) replace the goods with non-infringing substitutes provided that such substitutes do not entail a material diminution in performance or function; (c) modify the goods to make them non-infringing; or (d) refund the purchase price of the goods less a resonable amount for usage. The foregoing states our sole liability for intellectual property rights infringement.</li>
</ol>
<li>Limitation of Liability</li>
<ol>
<li>Neither of us will be entitled to, and neither of us shall be liable for, indirect, special, incidental, consequential or punitive damages of any nature, including, but not limited to, business interruption costs, loss of profit, removal and/or reinstallation costs, reprocurement costs, loss of data, injury to reputation or loss of customers. Your recovery from us for any claim shall not exceed the purchase price for the goods giving rise to such claim irrespective of the nature of the claim, whether in contract, tort, warranty or otherwise.</li>
<li>We shall not be liable for any claims based on our compliance with your designs, specifications or instructions or repair, modification or alteration of any goods by parties other than us or use in combination with other goods.</li>
</ol>
