INSERT [cmsPropertyData] ([id], [contentNodeId], [versionId], [propertytypeid], [dataInt], [dataDate], [dataNvarchar], [dataNtext]) VALUES (3547, 1208, N'e49a22b2-20ce-4725-8474-825e3c107bd8', 49, NULL, NULL, NULL, N'<ol>
